/**
 * 
 */
public void initialize(URL url, ContentObserver obs, JTabbedPane parent,
					   TransacOrigin trOrigin) 
{
	this.url = url;
	this.obs = obs;
	this.parent = parent;
	this.trOrigin = trOrigin;

	ivjidTxt.setText(obs.getIdElem());
	ivjurlTxt.setText(url.toString());
	
	try
	{
		ivjJEditorPane1.setPage(url);
	}
	catch(java.io.IOException e)
	{
		ivjJEditorPane1.setText(e.toString());
	}

	if (!obs.isWriter())
	{
		ivjJEditorPane1.setEditable(false);
		ivjsaveBtn.setEnabled(false);
	}
}
/**
 * Comment
 */
public void loadBtn_ActionPerformed() 
{
	try
	{
		try
		{
			ivjJEditorPane1.setPage(new URL(ivjurlTxt.getText()));
		}
		catch(MalformedURLException e)
		{
			ivjJEditorPane1.setPage(ivjurlTxt.getText());
		}
	}
	catch(java.io.IOException e)
	{
		ivjJEditorPane1.setText(e.toString());
	}
}
